import banner_img from './assets/homedisplay.png';

const Banner = () => {
    return(
        <div className='row mt-4'>
            <img className="homedisplay" src={banner_img} alt='titikman-banner'/>
        </div>
    );

}


const Card = (props) => {
    return(
        <>
            <div className="col-md-4 mb-4">
                <div className="card">
                <a href="subway.html">
                    <img src="assets/subway.jpg" className="card-img-top" alt="Food Image 1"/>
                </a>
                <div className="card-body">
                    <h5 className="card-title">{props.restoName}</h5>
                    <p>{props.description}</p>
                    <div className="rating">
                    <span className="fas fa-star checked"></span>
                    <span className="rating-number">{props.avgRating}</span>
                    </div>
                </div>
                </div>
            </div>
        
        </>
    );
}

const Home = () => {

    return(
        <div className='Home'>
            <Banner />

            <div className="container-fluid mt-3">
                <div className='row'>
                    <Card />
                </div>

            </div>

        </div>


    );
    
}

export default Home;
